from collections import defaultdict
class Solution:
    def numMatchingSubseq2(self, S, words):
        r=0
        index=[0 for w in words]
        for s in S:
            for i,w in enumerate(words):
                if index[i]<len(w) and w[index[i]]==s:
                    index[i]+=1
        for i,w in enumerate(words):
            if index[i]==len(w):
                r+=1
        return r

    def numMatchingSubseq(self, S, words):
        """
        :type S: str
        :type words: List[str]
        :rtype: int
        """

        w= defaultdict(list)
        count = 0
        for i in range(len(S)):  # 记下来每个字母出现的位置
            w[S[i]].append(i)

        for i in range(len(words)):
            nextCharPos = -1
            flag2 = True
            for j in range(len(words[i])):
                c = words[i][j]
                if w[c] == []:  # 这个字母在s中存在才有可能是子串
                    flag2 = False
                    break
                else:  # 如果不在，该串不是子串
                    flag = True  # 是否找到合适的下一个字母
                    for k in range(len(w[c])):
                        if w[c][k] > nextCharPos:
                            nextCharPos = w[c][k]
                            flag = False
                            break
                    if flag:  # 如果没找到合适的字母，该串不是子串
                        flag2 = False
                        break
            if flag2:
                count = count + 1
        return count

